import React, { useState, useEffect } from "react";
function App() {
  const onStartHandling = () => {
    fetch("http://127.0.0.1:5000")
      .then((response) => {
        response.json();
      })
      .then((responseData) => {
        console.log(responseData);
      });
  };

  return <button onClick={() => onStartHandling()}>Start</button>;
}

export default App;
